        <div className="payment_card">
          <p className="notice">Hello dear student,

Please pay  20,000 for Rapid Course of Amazon fba wholesale 
Please deposit to the account number below and don't forget to fill out this form and upload the screenshot of your payment receipt in this form here:
https://form.jotform.com/222736750314453
</p>
        </div>
      </div>
    </>
  );
};

